import * as React from "react";
import axios from "axios";
// Style
import './GutterUserSettings.styl'; 
// Icons
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faArrowRight
} from '@fortawesome/free-solid-svg-icons';

//
// GraphQL 
//

import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
const GET_USER_SETTINGS = gql`
    query getUser {
        getUser {
            _id
            name
            email
            avatar
        }
    }
`;
const UPDATE_USER = gql`
    mutation updateUser($UserInput: UserInput!) {
        updateUser(UserInput:$UserInput)
    }
`;
const S3_GENERATE_URL = gql`
    mutation s3GenerateUrl($Key: String, $ContentType: String) {
        s3GenerateUrl(Key:$Key, ContentType:$ContentType) {
            url
            name
            fileType
        }
    }
`;

//
// Types
//

type GutterUserSettingsProps = {
    toggleGutter
    toggleMenu
    toggleGutterLoader
}

//
// Function
//

const GutterUserSettings: React.FunctionComponent<GutterUserSettingsProps> = (props:any) => {

    // Set States
    const [userSettings, setUserSettings] = React.useState(null);
    const [uploadFile, setUploadFile] = React.useState(null);
    // GraphQL - Q's
    const { loading, error, data } = useQuery(GET_USER_SETTINGS);
    // GraphQL - M's
    const [ updateUser, { loading:userUpateLoading, error:userUpateError }] = useMutation(UPDATE_USER);
    const [ s3GenerateUrl, { loading:s3GenerateUrlLoading, error:s3GenerateUrlError }] = useMutation(S3_GENERATE_URL);

    //
    // Check & Set Data
    //

    if(data && !loading && !error) {
        if(!userSettings) {
            setUserSettings(data.getUser)
        }
    }

    //
    // OnChange
    //

    const onChange = (event) => {
        let newData = {...userSettings}; 
        newData[event.target.name] = event.target.value; 
        setUserSettings(newData);
    }

    // 
    // Upload Avatar
    //

    const uploadAvatar = async (e) => {
        event.preventDefault();
        const files = e.target.files;
        if (files && files.length > 0) {
            const file = files[0];          
            try {
                const ext = file.name.slice((file.name.lastIndexOf(".") - 1 >>> 0) + 2);
                const name = Math.floor(Date.now() / 1000);
                const res = await s3GenerateUrl({
                    variables: {
                        Key: name+'.'+ext,
                        ContentType: file.type
                    }
                });       
                if(res.data.s3GenerateUrl) {                               
                    const aws = await axios.put(res.data.s3GenerateUrl.url, file, {
                        headers: { 'Content-Type':res.data.s3GenerateUrl.fileType, 'x-amz-acl': 'public-read' }
                    } )
                    if(await aws) {
                        if(aws.status === 200) {
                            const res = await updateUser({
                                variables: {
                                    UserInput: { _id:userSettings._id, avatar:name+'.'+ext }
                                }
                            });
                            if(res.data.updateUser) {
                                console.log("User has been updated!");
                            } 
                        } else {
                            console.log('Error has occured');
                        }                 
                    }
                }
            } catch(err) {
                console.log(`Error (`+err+`)`);
            }
        }
    };

    //
    // Toggle Upload Avatar
    //

    const toggleUploadAvatar = async () => {
        document.getElementById('upload-user-avatar-image').click();
    }

    //
    // Submit Update
    //

    const submitUser = async () => {
        event.preventDefault();
        props.toggleGutterLoader(true,'loading','Saving...','Please wait');
        try {
            const res = await updateUser({
                variables: {
                    UserInput: userSettings
                }
            });
            if(res.data.updateUser) {
                props.toggleGutterLoader(true,'success','Good Stuff','Settings Saved');
                const timer = setTimeout(() => {
                    props.toggleGutterLoader(false,'success','Good Stuff','Settings Saved');
                    props.toggleGutter('','one-active');
                }, 4000);
                return () => clearTimeout(timer);
            } 
        } catch(err) {
            props.toggleGutterLoader(true, 'error', 'Error', err);
        }
    }

    // Return
    return (
        <div className="gutter-user-settings">
            <div className="settings-header">
                <h1>User Settings</h1>
                <div className="header-back-button" onClick={(event) => props.toggleGutter('','one-active')}><FontAwesomeIcon icon={faArrowRight}/></div>
            </div>
                {userSettings && 
                    <>
                        <input style={{display:'none'}}
                            id='upload-user-avatar-image'
                            type='file'
                            accept='image/*'
                            onChange={uploadAvatar}
                        />
                        <div className="settings-avatar" onClick={toggleUploadAvatar}>
                            <div className="avatar-image" style={{'backgroundImage':`url(https://seedeck-user-uploads.s3.eu-west-2.amazonaws.com/${userSettings.avatar})`}}>{userSettings.avatar === '' && userSettings.name[0]}</div>                            
                            <div className="avatar-title">Upload Avatar</div>
                            <div className="avatar-label">(Jpg, Png, 4mb Max)</div>
                        </div>
                    </>
                }
                {userSettings && 
                    <form onSubmit={submitUser}>
                        <div className="form-label">Full Name</div>
                        <input type="text" onChange={(event) => onChange(event)}  name="email" placeholder="Email Address" value={userSettings.email || ""}/><br/>
                        <div className="form-label">Email Address</div>
                        <input type="text" onChange={(event) => onChange(event)} name="fullName" placeholder="Full Name" value={userSettings.name || ""}/><br/>
                        <div className="form-label">Display Name</div>
                        <input type="text" onChange={(event) => onChange(event)}  name="displayName" placeholder="Display Name" value={userSettings.email || ""}/><br/>  
                        <div className="form-footnote">This could be your first name, or a nickname  however youd like people to refer to you in Seedeck.</div>
                        <div className="form-label">What I Do</div>
                        <input type="text" onChange={(event) => onChange(event)}  name="role" placeholder="What I Do" value={userSettings.email || ""}/><br/>     
                        <div className="form-footnote">Let people know what you do or what your role is.</div>
                        <button>Update User</button>
                    </form>
                }
        </div>
    );
};

export default GutterUserSettings
